-- Create temporary tables to hold our data
CREATE TEMPORARY TABLE temp_organismo (
    nome_cientifico TEXT,
    familia TEXT
);

CREATE TEMPORARY TABLE temp_nome_popular (
    nome_cientifico TEXT,
    nome TEXT
);

CREATE TEMPORARY TABLE temp_peptideo (
    pub_idx INTEGER,
    nome_cientifico TEXT,
    identificador TEXT,
    sequencia TEXT,
    quantidade_aminoacidos INTEGER,
    massa_molecular NUMERIC,
    banco_dados TEXT,
    palavras_chave TEXT
);

CREATE TEMPORARY TABLE temp_pub (
    publicacao_id INTEGER,
    idx INTEGER,
    doi TEXT,
    titulo TEXT
);

