-- Now process the data
DO $$
DECLARE
    org_row RECORD;
    nome_popular_row RECORD;
    pep_row RECORD;
    pub_row RECORD;
    org_id INTEGER;
    pub_id INTEGER;
    nome_popular_id INTEGER;
    pep_id INTEGER;
BEGIN
    -- First, insert all nome_popular
    FOR nome_popular_row IN SELECT * FROM temp_nome_popular LOOP
        INSERT INTO "nome_popular" ("nome")
        VALUES (nome_popular_row.nome)
        ON CONFLICT DO NOTHING;
    END LOOP;

    -- Then, insert all organisms
    FOR org_row IN SELECT * FROM temp_organismo LOOP
        INSERT INTO "organismo" ("nome_cientifico", "familia")
        VALUES (org_row.nome_cientifico, org_row.familia)
        RETURNING id INTO org_id;

        -- Insert nome_popular for this organism
        FOR nome_popular_row IN SELECT nome FROM temp_nome_popular WHERE nome_cientifico = org_row.nome_cientifico LOOP
            SELECT id INTO nome_popular_id FROM "nome_popular" WHERE nome = nome_popular_row.nome;
            INSERT INTO "organismo_to_nome_popular" ("organismo_id", "nome_popular_id")
            VALUES (org_id, nome_popular_id);
        END LOOP;
    END LOOP;

    -- Then, insert all publications
    FOR pub_row IN SELECT * FROM temp_pub LOOP
        INSERT INTO "publicacao" ("doi", "titulo")
        VALUES (pub_row.doi, pub_row.titulo)
        RETURNING id INTO pub_id;

        -- Update temp_pub with the new publication id
        UPDATE temp_pub SET publicacao_id = pub_id WHERE idx = pub_row.idx;
    END LOOP;

    -- Now, process peptides
    FOR pep_row IN SELECT * FROM temp_peptideo LOOP
        -- Get the organismo_id
        SELECT id INTO org_id FROM "organismo" WHERE nome_cientifico = pep_row.nome_cientifico;

        -- Insert peptideo
        INSERT INTO "peptideo" (
            "identificador",
            "sequencia",
            "quantidade_aminoacidos",
            "massa_molecular",
            "organismo_id",
            "banco_dados",
            "palavras_chave"
        )
        VALUES (
            pep_row.identificador,
            pep_row.sequencia, 
            pep_row.quantidade_aminoacidos,
            pep_row.massa_molecular,
            org_id,
            pep_row.banco_dados,
            pep_row.palavras_chave
        )
        RETURNING id INTO pep_id;

        -- Get the publicacao_id
        SELECT publicacao_id INTO pub_id FROM temp_pub WHERE idx = pep_row.pub_idx;

        -- Insert peptideo_to_publicacao
        IF pub_id IS NOT NULL THEN
            INSERT INTO "peptideo_to_publicacao" ("peptideo_id", "publicacao_id")
            VALUES (pep_id, pub_id);
        END IF;
    END LOOP;
END $$;

-- Clean up: drop the temporary tables
DROP TABLE temp_organismo;
DROP TABLE temp_nome_popular;
DROP TABLE temp_peptideo;
DROP TABLE temp_pub;
